function setsize() {
	var viewportWidth = $(window).width();
	var viewportHeight = $(window).height();
	$('#chart2b').width(viewportWidth-9);
	if (viewportHeight>617) {
		$('#chart2b').height(viewportHeight-117);
	}
	else {

		$('#chart2b').height(500);
	}
	//alert("viewport size:"+viewportWidth+" x "+viewportHeight);
}

function resizeAction() {
	setsize();
	$('#chart2b').empty();
	setTimeout(function() {                                    
       plot2b.replot({resetAxes:true});
    }, 200);
}


function onDeviceReady() {
	try {
	    if (!window.openDatabase) {
	        alert('window.openDatabase - not supported');
	    } else {
	        var shortName = 'IVF-Success-Rate';
	        var version = '1.0';
	        var displayName = 'IVF-Success-Rate';
	        var maxSize = 1024 * 1024; // 1MB ... in bytes
			// Note var db at head of code
	        db = window.openDatabase(shortName, version, displayName, maxSize);
			//alert(db); // You should have a database instance in db.

			//UNCOMMENT 1 Lines below to refresh DB ... not successfully tested..
			sessionStorage.dbCreated="false";
	    }
	} catch(e) {
	    // Error handling code goes here.
	    if (e == 2) {
	        // Version number mismatch.
	        alert("Invalid database version.");
	    } else {
	        alert("Unknown error "+e+".");
	    }
	    return;
	} 
	if (sessionStorage.dbCreated!="true") {
    	//alert("dbCreated false call pop db");
		db.transaction(populateDB, transaction_error,refreshFilters);
	}
	else {
		db.transaction(refreshFilters, transaction_error);
	}
}






